import TeamMember from "./TeamMember";

function Team(){
    const info=[
            {nime:"Walter White",img:"/img/WalterWhite.jpg",pos:"actor",phone:"0669638235",imail:"benkaida@gmail.com",},
            {nime:"Walter White",img:"/img/WalterWhite.jpg",pos:"actor",phone:"0669638235",imail:"benkaida@gmail.com", website:"www.prakingbad.com" },
            {nime:"Walter White",img:"/img/WalterWhite.jpg",pos:"actor", phone:"0669638235",imail:"benkaida@gmail.com", website:"www.prakingbad.com"}]
const mmbers=info.map(
    function(member){
    return <TeamMember
        img={member.img}
        nime={member.img}
        img={member.img}
        img={member.img}
        />
});
    return(
        <div className="row">
            <TeamMember />
        </div>
    )
}
export default Team;
